import './footer.css'

function Footer() {
    return (
        <div className="footer">
            <Icon>add_circle</Icon>
<Box component="span" sx={visuallyHidden}>Create a user</Box>
            <span className='footer-text'>+7 (984) 193 37-92</span>
            <span className='footer-text'>Приморсикй край г. Артём, ул. Достоевского д.64</span>
        </div>
    )
}


export default Footer;
